import React from 'react';
import { Link } from 'react-router-dom'; // Ukoliko koristite React Router

function NavigacioniBar() {
  return (
    <div className="navbar">
      <Link to="/about">O nama</Link>
      <Link to="/nutrition">Ishrana</Link>
      <Link to="/training">Trening</Link>
    </div>
  );
}

export default NavigacioniBar;
